import React, { useState } from "react";
import { Box } from "@mui/system";
import Paper from "@mui/material/Paper";

function UserList() {
  return (
    <Box
      sx={{
        display: "flex",
        flexWrap: "wrap",
        "& > :not(style)": {
          m: 1,
          width: 500,
          height: 500,
        },
      }}
      position="relative"
      bottom="2rem"
      left="40rem"
    >
      <Paper />
    </Box>
  );
}

export default UserList;
